message:
Vamos lembrar do que se trata.  Tem gente que ainda confunde a narrativa.  Este é Lula, um adorador de Satanás que foi enviado por fraude para o cargo presidencial no Brasil.  A eleição do Brasil foi fraudada usando os sistemas Dominion e Smartmatic que usam urnas eletrônicas, em favor do servo satanista da NOM.  E isso acontece em todos os países do mundo.  Depois de vários anos preso por corrupção, Lula foi levado para ser usado para reprimir o movimento de libertação antiglobalista.  ▪️O que aconteceu hoje no Brasil lembra muito o dia 6 de janeiro no Capitólio dos Estados Unidos.  Parece que a escuridão contratou provocadores para invadir os prédios do Congresso e do Supremo Tribunal Federal para provocar o protesto pacífico do povo brasileiro e causar repressão contra eles.  ▪️ A mudança no Brasil acontecerá simultaneamente com a dos EUA.

